import React from "react";

function PostModel() {
  return (
    <div className="post fixed h-[100%] overflow-hidden left-0 top-0 right-0 bg-[#0e0e0e7e] flex items-center justify-center">
      <div className="w-[500px] h-[400px] bg-white border-2"></div>
    </div>
  );
}

export default PostModel;
